import React from 'react'
import { 
    LineChart, Line, CartesianGrid, XAxis, YAxis, Tooltip,
} from 'recharts';
// import { Row , Col } from 'reactstrap'
import {Calendar} from 'react-big-calendar'
import moment from 'moment'
import 'react-calendar/dist/Calendar.css';

import {CommonCard} from '../../components/cards/CommonCard'


//example data
const data = [{name: 'Page A', uv: 400, pv: 2400, amt: 2400},
{name: 'Page B', uv: 200, pv: 2400, amt: 2400},
{name: 'Page C', uv: 400, pv: 2400, amt: 2400},
{name: 'Page D', uv: 400, pv: 2400, amt: 2400}, ];

// Setup the localizer by providing the moment (or globalize) Object
// to the correct localizer.
const localizer = Calendar.momentLocalizer(moment) // or globalizeLocalizer

export default function Home() {
    return (
        <div>
            <CommonCard width={"100%"}>
            <LineChart width={600} height={300} data={data} margin={{ top: 20, right: 20, bottom: 5, left: 0 }}>
                <Line type="monotone" dataKey="uv" stroke="#8884d8" />
                <CartesianGrid stroke="#ccc" strokeDasharray="5 5" />
                <XAxis dataKey="name" />
                <YAxis />
                <Tooltip />
            </LineChart>
            </CommonCard>
            <CommonCard>
                <Calendar
                    localizer={localizer}
                    events={myEventsList}
                    startAccessor="start"
                    endAccessor="end"
                />
            </CommonCard>
        </div>
    )
}
